import React from "react";
import "../Styles/App.css";
import { Container, Grid } from "semantic-ui-react";
import Home from "./Home";
import Navbar from "./Navbar";
import About from "./About";
import Projects from "./Projects";
import Contact from "./Contact";

class Main extends React.Component {
  render() {
    return (
      <>
        <Container fluid className="home">
          <Navbar />
          <Home />
        </Container>

        <Grid stackable>
          <Container fluid>
            <Grid.Row>
              <div id="about" className="fullPage">
                <hr />
                <About />
              </div>
            </Grid.Row>
          </Container>

          <Container fluid>
            <Grid.Row stretched>
              <div id="projects" className="fullPage">
                <hr />
                <Projects />
              </div>
            </Grid.Row>
          </Container>

          <Grid.Row stretched className="height100">
            {/* <Container fluid> */}
            <div id="contact" className="fullPage">
              <hr />
              <Contact />
            </div>
          </Grid.Row>
        </Grid>
      </>
    );
  }
}

export default Main;
